import React from 'react'
import './DropDownInput.css'

class DropDownInput extends React.Component {
    render() {
        return (
            <div className='input'>
                <select id="Visible">
                    <option value="Naples">Приватный</option>
                    <option value="London">Публичный</option>
                </select>
            </div>
        ) 
    }
}

export default DropDownInput
